FORM_ITEM.addEventListener("submit", function (event) { event.preventDefault(); subBox(); });

let enteredCodes = [];
let index = 0;
let count = 0;
madTime = 0;

function checkCode(code) {
	if (code == "")
		return { valid: false, i: 0 };

	for (var h in codeHashes) {
		var result = ""
		try {
			result = decrypt(code, codeHashes[h])
		} catch (err) {
			result = ""
		}
		if (result == code)
			return { valid: true, i: h };
	}

	return { valid: false, i: 0 };
}

function encrypt(code, content) {
	return CryptoJS.AES.encrypt(content, code).toString();
}

function decrypt(code, content) {
	let bytes = CryptoJS.AES.decrypt(content, code);
	return bytes.toString(CryptoJS.enc.Utf8);
}

function subBox() {
	if (count >= 3) {
		// someone's being naughty with the lock button
		return;
	}
	var entered = CODE_BOX.value.toUpperCase();
	console.log("Entered: " + entered);
	// TODO: crypto
	let { valid, i } = checkCode(entered);
	if (valid && !enteredCodes.includes(entered)) {
		enteredCodes.push(entered);
		index += Math.pow(2, i);
		count++;
		CODE_BOX.value = "";
		HINT_ITEM.style.opacity = 1;
		if (count == 1) {
			HINT_ITEM.textContent = "FIND TWO FRIENDS";
		} else if (count == 2) {
			HINT_ITEM.textContent = "FIND ONE MORE";
		} else {
			HINT_ITEM.style.opacity = 0;
		}

		if (count == 3) {
			unlock();
		}
	} else {
		reset();
	}

}

function reset() {
	enteredCodes = [];
	count = 0;
	madTime = 4;
	index = 0;
	LOCK_ITEM.src = "assets/lock_body_red.png";
	CODE_BOX.value = "";
	HINT_ITEM.style.opacity = 0;
}

function unlock() {
	// actually unlock
	let codePass = enteredCodes.sort().join("");

	// look up which passkey corresponds to these codes:
	let encryptedPass = passkeys[index];

	let pass = decrypt(codePass, encryptedPass);
	let newPage = decrypt(pass, unlocked);

	console.log(newPage);

	LOCK_ITEM.src = "assets/" + locks[6];
	CODE_BOX.disabled = true;
	LOCK_PIN.style.transform = "translate(0, 15px)";

	// change the page after animation finishes
	setTimeout(function () {
		console.log("GOODBYE WORLD!");
		document.open();
		document.write(newPage);
		document.close();
	}, 5000);

	setTimeout(function () {
		BLOCKER.style.opacity = "1";
	}, 3000);
}

var line = true;
var ticker = setInterval(function () {
	if (madTime > 0) {
		madTime--;
		return;
	}

	if (count == 3) {
		return;
	}

	line = !line;

	if (line) {
		LOCK_ITEM.src = "assets/" + locks[count * 2];
	} else {
		LOCK_ITEM.src = "assets/" + locks[count * 2 + 1];
	}

}, 500);

console.log("Initializing...")

LOCK_BODY.addEventListener("click", subBox, false);

